import React from 'react';
import './MainSection.css';

const MainSection = () => {
    return (
        <div className="main-section">
            <div className="main-section-content">
                <h2>Welcome to the Stanford Vision and Learning Lab (SVL)</h2>
                <p>We at the Stanford Vision and Learning Lab (SVL) tackle fundamental open problems in computer vision research. We are intrigued by visual functionalities that give rise to semantically meaningful interpretations of the visual world.</p>
                <p>Join us: If you are interested in research opportunities at SVL, please fill out this <a href="link-to-application">application survey</a>. (Stanford students only)</p>
            </div>
        </div>
    );
};

export default MainSection;
